{"id": "49235", "title": "Bug 49235 - ServletContainerInitializer onStartup(Set<Class<? classSet is not correct", "description": "I built Tomcat 7.0.0 from svn r939221. Below is my code:

@MySomeAnn
public class MySomeClass{
...}

@HandlesTypes(MySomeAnn.class)
public class ModuleInitializer implements ServletContainerInitializer{

    @Override
    public void onStartup(Set<Class<?>> classSet, ServletContext ctx) throws ServletException {
        for (Class<?> targetClass : classSet){
            System.out.println(targetClass.getName());
        }
    }

}

The expected output should be "MySomeClass", but the actual output is "MySomeAnn".", "OB": "The onStartup() method of ModuleInitializer class is receiving a set of classes as input, but the actual output from the method is not as expected. The expected output is "MySomeClass", but the actual output is "MySomeAnn".", "EB": "The onStartup() method of ModuleInitializer class is not correctly handling the input set of classes. It should print the name of each class in the set, starting with "MySomeClass".", "SR": "Please modify the onStartup() method in ModuleInitializer class to correctly handle the input set of classes and print their names. The method should iterate over the classSet and print the name of each class, starting with "MySomeClass"."}
